import React from "react";
import { sum, sub, mult, division } from "./Calc";

const calcCss = {
  backgroundColor: "blue",
  justifyContent: "center",
  alignItems: "center",
  width: "30%",
  height: "250px",
  borderRadius: "2%",
  boxSizing: "border-box",
  boxShadow: "0px 5px ffe9c5",
  textShadow: "0px 2px 4px #ffe9c5",
  margin: "0px 35% 10px",
};

function Calculation() {
  return (
    <>
      <ol style={calcCss}>
        <h1>The Sum of two numbers is : {sum(2, 4)}</h1>
        <h1>The Subtraction of two numbers is{sub(2, 4)}</h1>
        <h1>The multilication of two numbers{mult(2, 5)}</h1>
        <h1>The Division of two numbers{division(2, 5)}</h1>
      </ol>
    </>
  );
}
export default Calculation;
